import React, { useState, useEffect, useRef } from "react";
import axios from "axios";
import { getWaterBrands } from "../../data";

const RowSlider = () => {
  const [waterBrands, setWaterBrands] = useState([]);

  useEffect(() => {
    axios.get("http://3.39.164.17:8000/api/watersource/").then((response) => {
      setWaterBrands(response.data);
    });
  }, []);


  return (
    <div>
      {waterBrands.map((waterBrand) => (
        <img
          key={waterBrand.id}
          src={waterBrand.image_url}
          alt={waterBrand.name}
          style={{ width: "50px", height: "50px" }}
        />
      ))}
    </div>
  );
};

export default RowSlider;
